	function typeEffect(element, speed, delay) {

		setTimeout(function(){

			var text = $(element).text();
			$(element).html('');
			$(element).css('opacity', '1');

			var i = 0;
			var timer = setInterval(function(){
				if (i < text.length)
				{
					$(element).append(text.charAt(i));
					i++;
				} 
				else 
				{
					clearInterval(timer);
				}
			}, speed);

		}, delay);
	}

